import 'bootstrap/dist/css/bootstrap.min.css'
import { BrowserRouter } from "react-router-dom";
import {useRoutes} from "./routes"


const routes = useRoutes(false)
function App() {
  return (
    <BrowserRouter>
        <div className="container">
          {routes}
        </div>
    </BrowserRouter> 
  );
}

export default App;
